import React from 'react';
import './Projects.css';

const projectsData = [
  {
    title: "NurseAssist (SunHacks)",
    description: "Developed a tool to measure blood pressure, temperature, blood oxygen levels, and blood sugar using Raspberry Pi 4, MX30102 and DS18B20 sensors. Utilized Python for backend processing, storing data in a MySQL database accessible to healthcare professionals. Built a responsive website using HTML, CSS, JavaScript, and React, aimed at reducing nurses' workload.",
    link: "https://github.com/Nairinn/Nurse-Assist",
    image: "https://i.pinimg.com/originals/f9/57/6f/f9576fca9fc8ef79976a1d6327bbe9ae.gif",
  },
  {
    title: "WebSync",
    description: "Crafted a Video Conferencing Website harmonizing JavaScript, HTML, CSS, Node.js, Python, and Java for large corporate meetings and coding collaborations. Integrated video conferencing with advanced IDEs and document editors.",
    link: "https://github.com/Nairinn/WebSync",
    image: "https://i.pinimg.com/originals/8b/35/fe/8b35fef55fba1a201c9c7a11d3ec3d64.gif",
  },
  {
    title: "MedPredict",
    description: "Developing a platform that leverages Java, HTML, CSS, JavaScript, Node.js, and React.js to reduce diagnosis time by 30% while achieving a projected accuracy rate of 98%. Implemented GPT-3 and advanced prompt engineering techniques to optimize the diagnostic process.",
    link: "https://github.com/Nairinn/MedPredict",
    image: "https://i.pinimg.com/originals/f5/8f/e8/f58fe8e19a7e25ddf0c459a3599261d6.gif",
  },
  {
    title: "The Garden",
    description: "Built a website using HTML, JavaScript, and CSS to enhance memory and motor skills for dementia patients through three targeted games.",
    link: "https://github.com/ForgotSemiColon/Master-Project",
    image: "https://i.pinimg.com/originals/b1/5b/d5/b15bd596014d9d9310e59b07b85da550.gif",
  },
];

const Projects = () => {
  return (
    <div className="projects-container">
      <h2>Projects</h2>
      <div className="projects-grid">
        {projectsData.map((project, index) => (
          <div className="project-box" key={index}>
            <img src={project.image} alt={project.title} className="project-image" />
            <div className="project-info">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">View Project</a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
